pragma solidity >=0.8.0;
interface Callee {
    function addtwo(uint _value) external returns (uint result);
}    
contract Caller {
    Callee internal callee;
    uint public store;
    function someAction(address _addr, uint _number) public {
        callee = Callee(_addr);
        store = callee.addtwo(_number);
    }
}
